ADF_CustomActions.preAction:
//TODO - insert activation code
var currentDate = new Date();
var stringDate = currentDate.getFullYear() + "-" + ("0" + (currentDate.getMonth() + 1)).slice(-2)
+ "-" + ("0" + (currentDate.getDate() + 1)).slice(-2);


var nextDate = new Date();
nextDate.setDate(currentDate.getDate() + 5);

var stringNextDate = nextDate.getFullYear() + "-" + ("0" + (nextDate.getMonth() + 1)).slice(-2)
+ "-" + ("0" + (nextDate.getDate() + 1)).slice(-2);

ADFBridgeService.widgetMap.VISA_TravelModeScreen1_InputStartDate.propertyHandler.data.text = stringDate;
ADFBridgeService.widgetMap['VISA_TravelModeScreen1_InputStartDate'].propertyHandler.behaviourProperties.text = stringDate;

ADFBridgeService.widgetMap.VISA_TravelModeScreen1_InputEndDate.propertyHandler.data.text = stringNextDate;
ADFBridgeService.widgetMap['VISA_TravelModeScreen1_InputEndDate'].propertyHandler.behaviourProperties.text = stringNextDate;

$timeout(function () {
ADFBridgeService.postNotification('ATKLoadDataNotification', {
